import React from 'react';
import logo from './logo.png';
import { Container, Row, Col } from 'reactstrap';
import './App.css';
import instagram from './assets/instagram.png';
import gmail from './assets/gmail.png';
import whatsapp from './assets/whatsapp.png';


function App() {
  return (
    <div className="App" style={{ backgroundColor: '#f5f5ed' }}>
      <header className="App-header" >
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          We have raised RM50,000 for the marginalized youth
        </p>

      </header>

      <div class="flex-grid">
        <div class="col">
          <a href='https://www.instagram.com'>
            <img alt="instagram" src={instagram} />
          </a>
        </div>
        <div class="col">
          <a href='https://www.whatsapp.com'>
            <img alt="whatsapp" src={whatsapp} />
          </a>
        </div>
        <div class="col">email</div>
      </div>

      {/* <Container style={{ backgroundColor: '#f5f5ed' }}>
        <Row className="Icons">
          <Col xs='6' sm='4'>instagram</Col>
          <Col xs='6' sm='4'>whatsaoo</Col>
          <Col xs='6' sm='4'>email</Col>
        </Row>
      </Container> */}


    </div >
  );
}

export default App;
